interface IActiveNFT is ISharedStruct {
    struct ActiveInfo {
        uint activeId;
        address ownerOfRequest;
        uint itemId;
        uint amount;
        uint requestedTime;
        uint activedTime;
        bool isRequested;
        bool isActive;
    }

